import React from "react";
import tw from "tailwind-styled-components";

const Nav = tw.div`
w-full
h-20
shadow-md
fixed
top-0
left-0
flex
items-center
bg-black
text-blue-200
hover:bg-purple-900`;

const Logo = tw.div`
bg-red-400
m-4
w-30
h-14
flex
items-center
justify-center
font-bold
`;

const Navbar = () => {
  return (
    <Nav>

      <Logo>WA-HIRED</Logo>
      <NavItemWrapper></NavItemWrapper>

    </Nav>
  );
};

export default Navbar;
